parameters.inputSchema:
{
	"type": "object",
	"properties": {
		"rfpTitle": {
			"type": "string",
			"description": "Title of the RFP"
		},
		"rfpDescription": {
			"type": "string",
			"description": "Brief description of the RFP"
		},
		"submissionDeadline": {
			"type": "string",
			"description": "Deadline for RFP submission in ISO format"
		},
		"productRequirements": {
			"type": "string",
			"description": "Summary of product requirements"
		},
		"testingAndAcceptance": {
			"type": "string",
			"description": "Summary of testing and acceptance criteria"
		},
		"sourceUrl": {
			"type": "string",
			"description": "Original URL of the RFP"
		},
		"rfpFullText": {
			"type": "string",
			"description": "Complete RFP text content"
		},
		"quantity": {
			"type": "number",
			"description": "Quantity of items required"
		}
	}
}

{
	"type": "object",
	"properties": {
		"technicalContext": {
			"type": "string",
			"description": "Technical summary including hardware specs, scope of supply, and product requirements"
		},
		"pricingContext": {
			"type": "string",
			"description": "Pricing summary including commercial terms, required tests, acceptance criteria, and quantities"
		},
		"quantity": {
			"type": "number",
			"description": "Quantity of items required"
		}
	}
}

{
	"type": "object",
	"properties": {
		"recommendedSku": {
			"type": "string",
			"description": "Top recommended product SKU"
		},
		"specMatchPercentage": {
			"type": "number",
			"description": "Percentage match between product specs and RFP requirements"
		},
		"technicalJustification": {
			"type": "string",
			"description": "Explanation of why this SKU matches the requirements"
		}
	}
}

{
	"type": "object",
	"properties": {
		"unitPrice": {
			"type": "number",
			"description": "Unit price of the recommended SKU"
		},
		"serviceCosts": {
			"type": "number",
			"description": "Total service costs for required tests"
		},
		"totalUnitCost": {
			"type": "number",
			"description": "Total cost per unit including services"
		},
		"totalProjectCost": {
			"type": "number",
			"description": "Total project cost for all units"
		},
		"costBreakdown": {
			"type": "string",
			"description": "Detailed breakdown of all costs"
		}
	}
}

parameters.text:
=RFP Title: {{ $json.rfpTitle }}
Technical Context: {{ $json.technicalContext }}
Pricing Context: {{ $json.pricingContext }}
Quantity: {{ $json.quantity }}
